new ClipboardJS("#copy");const utils=function(){function addCSS(elem,css){document.querySelector(elem).classList.add(css)}function removeCSS(elem,css){document.querySelector(elem).classList.remove(css)}function toggleCSS(elem,css){document.querySelector(elem).classList.toggle(css)}function innerHTML(elem,string){document.querySelector(elem).innerHTML=string}function setElementAttribute(elem,attr,value){document.querySelector(elem).setAttribute(attr,value)}function refreshPage(){history.go(0)}function closeWindow(){close()}function toggleElem(elem){const el=document.querySelector(elem);el.getAttribute("aria-expanded")?(el.classList.remove("expanded"),el.setAttribute("aria-expanded",!1),el.setAttribute("hidden",!0)):(el.classList.add("expanded"),el.setAttribute("aria-expanded",!0),el.removeAttribute("hidden"))}function consoleLog(value,asDir){asDir?console.dir(value):console.log(value)}return{addCSS:addCSS,closeWindow:closeWindow,consoleLog:consoleLog,innerHTML:innerHTML,refreshPage:refreshPage,removeCSS:removeCSS,toggleCSS:toggleCSS,toggleElem:toggleElem,setElementAttribute:setElementAttribute}}();Shiny.addCustomMessageHandler("addCSS",(function(value){utils.addCSS(value[0],value[1])})),Shiny.addCustomMessageHandler("closeWindow",(function(event){utils.closeWindow()})),Shiny.addCustomMessageHandler("consoleLog",(function(value){utils.consoleLog(value[0],value[1])})),Shiny.addCustomMessageHandler("innerHTML",(function(value){utils.innerHTML(value[0],value[1])})),Shiny.addCustomMessageHandler("refreshPage",(function(event){utils.refreshPage()})),Shiny.addCustomMessageHandler("removeCSS",(function(value){utils.removeCSS(value[0],value[1])})),Shiny.addCustomMessageHandler("setElementAttribute",(function(value){utils.setElementAttribute(value[0],value[1],value[2])})),Shiny.addCustomMessageHandler("toggleCSS",(function(value){utils.toggleCSS(value[0],value[1])})),Shiny.addCustomMessageHandler("toggleElem",(function(value){utils.toggleElem(value[0],value[1])}));